import React from 'react';
import "./menu.css";


const Menu = () => {
  return (
    <div className="container-menu">
      <div>
      Greek Salad
        <img src="https://www.wellplated.com/wp-content/uploads/2022/05/Greek-Salad-Recipe-Easy.jpg" alt="Greek Salad" sizes="(max-width: 480px) 45vw, 45vw"/>
       
      </div>
      
      <div>Pizza Margherita</div>
      <div>Moroccan Tagine</div>
      <div>Moussaka</div>
      <div>Bruschetta</div>
      <div>Tabouli</div>
      <div>Shakshuka</div>
      <div>Falafel</div>
      <div>Lemon Meringue Tart</div>
    </div>
  )
}

export default Menu;
